import React, {useEffect} from 'react';
import { useDispatch, useSelector } from 'react-redux';

const Navbar = () => {
    const dispatch = useDispatch()
    const { getLogin } = useSelector((state) => state.JobReducer)

    
    return (
        <div>
            <nav className="navbar navbar-expand-lg bg-body-tertiary container">
                <div className="container">
                    <a className="navbar-brand col-1" href="#">
                        <img src="https://majalah.stfi.ac.id/wp-content/uploads/2014/09/Jobs21.jpg" alt="" className="img-fluid" />
                    </a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
                        <div className="navbar-nav d-flex justify-content-end col-12">
                            <a className="nav-link active" aria-current="page" href="/">Lowongan Kerja</a>
                            <a className="nav-link" href="#">Hai. olla</a>
                            <a className ="btn btn-danger" href="#">{
                                getLogin ? 'Logout' :'Login'
                            }</a>
                        </div>
                    </div>
                </div>
            </nav>
        </div>
    );
}

export default Navbar;
